import React from "react";
import Home from "./pages/out/Home.js";
import Signup from "./pages/out/Signup.js";
import SignupEmail from "./pages/out/SignupEmail.js";
import VSignupEmail from "./pages/out/VSignEmail.js";
import Reqnum from "./pages/lin/reqnum.js";
import Reqstep1 from "./pages/lin/reqstep1";
import Thankyou from "./pages/lin/thankyou.js";
import Usernum from "./pages/lin/usernum.js";
import ChooseWallet from "./pages/lin/chooseWallet.js";
import MintConfirm from "./pages/lin/MintConfirm.js";
import MintInProgress from "./pages/lin/MintInProgress.js";
import MyContract from "./pages/smart.js";
import SignupPhone from "./pages/out/SignupPhone.js";
// import { BrowserRouter, Routes, Route } from "react-router-dom";
import { HashRouter as Router, Route, Link, Switch }
              from 'react-router-dom';

function App() {
  return (
    <HashRouter>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route exact path="/signup" component={Signup} />
        <Route exact path="/signup-with-email" component={SignupEmail} />
        <Route exact path="/signup-with-phone" component={SignupPhone} />
        <Route exact path="/signup-with-email/verification" component={VSignupEmail} />
        <Route exact path="/request-number" component={Reqnum} />
        <Route exact path="/request-number/step1" component={Reqstep1} />
        <Route exact path="/request-number/step2/success" component={Thankyou} />
        <Route exact path="/my-numbers" component={Usernum} />
        <Route exact path="/request-number/step3/choose-wallet" component={ChooseWallet} />
        <Route exact path="/request-number/step3/confirm-mint" component={MintConfirm} />
        <Route exact path="/request-number/step3/mint-in-progress" component={MintInProgress} />
        <Route exact path="/contract" component={MyContract} />
      </Switch>
    </HashRouter>
  );
}

export default App;
